import React from "react";
import "./App.css";

function App() {
  return (
    <div>
      <div className="app__header">
        <img
          src="https://www.google.com/search?q=instagram+logo&sxsrf=ALeKk02l6liKfs-NUsFoyu1fQlMaqBTX9w:1598036924619&source=lnms&tbm=isch&sa=X&ved=2ahUKEwjz1Oq5_6zrAhU8IDQIHdMYDf4Q_AUoAXoECA4QAw&biw=597&bih=925#imgrc=Ik95gpteyCsJuM"
          alt=""
          className="app__headerImage"
        />
      </div>
    </div>
  );
}

export default App;
